import React from "react";
import { Movie } from "../Movie/Movie";
import { Preloader } from "../Preloader/Preloader";
import { Search } from "../Search/Search";
import "./Movies.css";

const Movies = (props) => {
  const { movies, searchMovie, changeBg } = props;
  console.log(movies);
  return (
    <React.Fragment>
      <Search searchMovie={searchMovie} />
      <div className="movie-container">
      { movies.length ? 
      movies.map((movie) => {
        console.log(movie);
        return (
          <Movie
            key={movie.imdbID}
            changeBg={() => {
              changeBg(movie.imdbID);
            }}
            poster={movie.Poster}
            title={movie.Title}
            type={movie.Type}
            year={movie.Year}
          />
        );
      }) : <Preloader />}
      </div>
    </React.Fragment>
  );
};

export { Movies };
